import React from "react";

const IndexIcons=(props)=>{
    let dots=[]
    for(let i=0;i<props.outline.length-1;i++){
        let dot
        if(i===props.index){
            dot=<i className="fa-solid fa-circle" style={{color:'darkGrey'}}></i>
        }else{
            dot=<i className="fa-normal fa-circle" style={{color:'lightGrey'}}></i>
        }
        dots.push(dot)
    }
    return dots
}

export default IndexIcons
